import React from "react";
import "./UserList.css";
import UserListItems from "./UserListItems";

const UserList = (props) => {
  // const a = props.items.map((item) => {
  //   return (userName = item.userName), (age = item.age);
  // });
  return (
    <div className="list-controler">
      <UserListItems
        userName={props.items[0].userName}
        age={props.items[0].age}
      />
    </div>
  );
};

export default UserList;
